import React from 'react';
import '../../App.css';

export default function Gallary() {
  return <h1 className='gallary'>Gallary</h1>;
  const photos = [
    {
      src: 'images/img12.jpg',
      width: 4,
      height: 3
    },
    {
      src: 'images/img13.jpg',
      width: 1,
      height: 1
    },
    {
      src: 'images/img14.jpg',
      width: 5,
      height: 4
    }
    /*
    {
      src: image15,
      width: 1,
      height: 1
    },
    {
      src: image16,
      width: 2,
      height: 2
    }
    */
  ];

  <Gallary photos={photos} />;

}



